Scorpions - I Can't Explain [promo].VOB



HQ promo music video. &quot;I Can't Explain&quot; is a song by the English rock band The Who, written by Pete Townshend, and produced by Shel Talmy. The song was issued as a single in December 1964 in the United States and on 15 January 1965 in the United Kingdom.

This song is ranked #9 on Pitchfork Media's list of the &quot;200 Greatest Songs of the 1960s&quot;, #59 on Spin's list of the &quot;100 Greatest Singles of All Time&quot;, and #371 on Rolling Stone's list of the &quot;500 Greatest Songs of All Time&quot;.

Scorpions recorded &quot;I Can't Explain&quot; for their 1989 compilation album Best of Rockers 'n' Ballads. This version was released as single via Polydor Records, and reached #5 on the Mainstream Rock Tracks chart.
